(155, 'C', '13', '139', '1392', 4, 'C-13-139', 'C-13-139-1392', '豆制品制造', '指以大豆、小豆、绿豆、豌豆、蚕豆等豆类为主要原料，经加工制成食品的活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(156, 'C', '13', '139', '1393', 4, 'C-13-139', 'C-13-139-1393', '蛋品加工', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(157, 'C', '13', '139', '1399', 4, 'C-13-139', 'C-13-139-1399', '其他未列明农副食品加工', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(158, 'C', '14', '', '', 2, 'C', 'C-14', '食品制造业', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(159, 'C', '14', '141', '', 3, 'C-14', 'C-14-141', '焙烤食品制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(160, 'C', '14', '141', '1411', 4, 'C-14-141', 'C-14-141-1411', '糕点、面包制造', '指用米粉、面粉、豆粉为主要原料，配以辅料，经成型、油炸、烤制而成的各种食品生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(161, 'C', '14', '141', '1419', 4, 'C-14-141', 'C-14-141-1419', '饼干及其他焙烤食品制造', '指以面粉（或糯米粉）、糖和油脂为主要原料，配以奶制品、蛋制品等辅料，经成型、焙烤制成的各种饼干，以及用薯类、谷类、豆类等制作的各种易于保存、食用方便的焙烤食品生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(162, 'C', '14', '142', '', 3, 'C-14', 'C-14-142', '糖果、巧克力及蜜饯制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(163, 'C', '14', '142', '1421', 4, 'C-14-142', 'C-14-142-1421', '糖果、巧克力制造', '糖果制造指以砂糖、葡萄糖浆或饴糖为主要原料，加入油脂、乳品、胶体、果仁、香料、食用色素等辅料制成甜味块状食品的生产活动；巧克力制造指以浆状、粉状或块状可可、可可脂、可可酱、砂糖、乳品等为主要原料加工制成巧克力及巧克力制品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(164, 'C', '14', '142', '1422', 4, 'C-14-142', 'C-14-142-1422', '蜜饯制作', '指以水果、坚果、果皮及植物的其他部分制作糖果蜜饯的活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(165, 'C', '14', '143', '', 3, 'C-14', 'C-14-143', '方便食品制造', '指以米、面、杂粮等为主要原料加工制成，只需简单烹制即可作为主食，具有食用简便、携带方便，易于储藏等特点的食品制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(166, 'C', '14', '143', '1431', 4, 'C-14-143', 'C-14-143-1431', '米、面制品制造', '指以米、面、杂粮等为原料，经粗加工制成，未经烹制的各类米面制品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(167, 'C', '14', '143', '1432', 4, 'C-14-143', 'C-14-143-1432', '速冻食品制造', '指以米、面、杂粮等为主要原料，以肉类、蔬菜等为辅料，经加工制成各类烹制或未烹制的主食食品后，立即采用速冻工艺制成的，并可以在冻结条件下运输储存及销售的各类主食食品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(168, 'C', '14', '143', '1439', 4, 'C-14-143', 'C-14-143-1439', '方便面及其他方便食品制造', '指用米、面、杂粮等为主要原料加工制成的，可以直接食用或只需简单蒸煮即可作为主食的各种方便主食食品的生产活动，以及其他未列明的方便食品制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(169, 'C', '14', '144', '1440', 3, 'C-14', 'C-14-1440', '乳制品制造', '指以生鲜牛（羊）乳及其制品为主要原料，经加工制成的液体乳及固体乳（乳粉、炼乳、乳脂肪、干酪等）制品的生产活动；不包括含乳饮料和植物蛋白饮料生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:36:10');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(170, 'C', '14', '145', '', 3, 'C-14', 'C-14-145', '罐头食品制造', '指将符合要求的原料经处理、分选、修整、烹调（或不经烹调）、装罐、密封、杀菌、冷却（或无菌包装）等罐头生产工艺制成的，达到商业无菌要求，并可以在常温下储存的罐头食品的制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(171, 'C', '14', '145', '1451', 4, 'C-14-145', 'C-14-145-1451', '肉、禽类罐头制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(172, 'C', '14', '145', '1452', 4, 'C-14-145', 'C-14-145-1452', '水产品罐头制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(173, 'C', '14', '145', '1453', 4, 'C-14-145', 'C-14-145-1453', '蔬菜、水果罐头制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(174, 'C', '14', '145', '1459', 4, 'C-14-145', 'C-14-145-1459', '其他罐头食品制造', '指婴幼儿辅助食品类罐头、米面食品类罐头（如八宝粥罐头等）及上述未列明的罐头食品制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(175, 'C', '14', '146', '', 3, 'C-14', 'C-14-146', '调味品、发酵制品制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(176, 'C', '14', '146', '1461', 4, 'C-14-146', 'C-14-146-1461', '味精制造', '指以淀粉或糖蜜为原料，经微生物发酵、提取、精制等工序制成的，谷氨酸钠含量在80％及以上的鲜味剂的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(177, 'C', '14', '146', '1462', 4, 'C-14-146', 'C-14-146-1462', '酱油、食醋及类似制品制造', '指以大豆和（或）脱脂大豆，小麦和（或）麸皮为原料，经微生物发酵制成的各种酱油和酱类制品，以及以单独或混合使用各种含有淀粉、糖的物料或酒精，经微生物发酵酿制的酸性调味品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(178, 'C', '14', '146', '1469', 4, 'C-14-146', 'C-14-146-1469', '其他调味品、发酵制品制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(179, 'C', '14', '149', '', 3, 'C-14', 'C-14-149', '其他食品制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(180, 'C', '14', '149', '1491', 4, 'C-14-149', 'C-14-149-1491', '营养食品制造', '指主要适宜伤残者、老年人，含肉、鱼、水果、蔬菜、奶、麦精、钙等均质配料的营养食品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 12:12:57');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(181, 'C', '14', '149', '1492', 4, 'C-14-149', 'C-14-149-1492', '保健食品制造', '指标明具有特定保健功能的食品，适用于特定人群食用，具有调节机体功能，不以治疗为目的，对人体不产生急性、亚急性或慢性危害，以补充维生素、矿物质为目的的营养素补充等保健食品制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 12:12:59');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(182, 'C', '14', '149', '1493', 4, 'C-14-149', 'C-14-149-1493', '冷冻饮品及食用冰制造', '指以砂糖、乳制品、豆制品、蛋制品、油脂、果料和食用添加剂等经混合配制、加热杀菌、均质、老化、冻结（凝冻）而成的冷食饮品的制造，以及食用冰的制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 12:13:03');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(183, 'C', '14', '149', '1494', 4, 'C-14-149', 'C-14-149-1494', '盐加工', '指以原盐为原料，经过化卤、蒸发、洗涤、粉碎、干燥、脱水、筛分等工序，或在其中添加碘酸钾及调味品等加工制成盐产品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 12:13:05');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(184, 'C', '14', '149', '1495', 4, 'C-14-149', 'C-14-149-1495', '食品及饲料添加剂制造', '指增加或改善食品特色的化学品，以及补充动物饲料的营养成分和促进生长、防治疫病的制剂的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 12:13:09');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(185, 'C', '14', '149', '1499', 4, 'C-14-149', 'C-14-149-1499', '其他未列明食品制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 12:13:13');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(186, 'C', '15', '', '', 2, 'C', 'C-15', '酒、饮料和精制茶制造业', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(187, 'C', '15', '151', '', 3, 'C-15', 'C-15-151', '酒的制造', '指酒精、白酒、啤酒及其专用麦芽、黄酒、葡萄酒、果酒、配制酒以及其他酒的生产', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(188, 'C', '15', '151', '1511', 4, 'C-15-151', 'C-15-151-1511', '酒精制造', '指用玉米、小麦、薯类等淀粉质原料或用糖蜜等含糖质原料，经蒸煮、糖化、发酵及蒸馏等工艺制成的酒精产品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(189, 'C', '15', '151', '1512', 4, 'C-15-151', 'C-15-151-1512', '白酒制造', '指以高粱等粮谷为主要原料，以大曲、小曲或麸曲及酒母等为糖化发酵剂，经蒸煮、糖化、发酵、蒸馏、陈酿、勾兑而制成的蒸馏酒产品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(190, 'C', '15', '151', '1513', 4, 'C-15-151', 'C-15-151-1513', '啤酒制造', '指以麦芽（包括特种麦芽）、水为主要原料，加啤酒花，经酵母发酵酿制而成，含二氧化碳、起泡、低酒精度的发酵酒产品（包括无醇啤酒，也称脱醇啤酒）的生产活动，以及啤酒专用原料麦芽的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(191, 'C', '15', '151', '1514', 4, 'C-15-151', 'C-15-151-1514', '黄酒制造', '指以稻米、黍米、黑米、小麦、玉米等为主要原料，加曲、酵母等糖化发酵剂发酵酿制而成的发酵酒产品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(192, 'C', '15', '151', '1515', 4, 'C-15-151', 'C-15-151-1515', '葡萄酒制造', '指以新鲜葡萄或葡萄汁为原料，经全部或部分发酵酿制而成，含有一定酒精度的发酵酒产品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(193, 'C', '15', '151', '1519', 4, 'C-15-151', 'C-15-151-1519', '其他酒制造', '指除葡萄酒以外的果酒、配制酒以及上述未列明的其他酒产品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(194, 'C', '15', '152', '', 3, 'C-15', 'C-15-152', '饮料制造', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(195, 'C', '15', '152', '1521', 4, 'C-15-152', 'C-15-152-1521', '碳酸饮料制造', '指在一定条件下充入二氧化碳气的饮用品制造，其成品中二氧化碳气的含量（20℃时的体积倍数）不低于2.0倍', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(196, 'C', '15', '152', '1522', 4, 'C-15-152', 'C-15-152-1522', '瓶（罐）装饮用水制造', '指以地下矿泉水和符合生活饮用水卫生标准的水为水源加工制成的，密封于塑料瓶（罐）、玻璃瓶或其他容器中，不含任何添加剂，可直接饮用的水的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
