INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(198, 'C', '15', '152', '1524', 4, 'C-15-152', 'C-15-152-1524', '含乳饮料和植物蛋白饮料制造', '指以鲜乳或乳制品为原料（经发酵或未经发酵），加入水、糖液等调制而成的可直接饮用的含乳饮品的生产活动，以及以蛋白质含量较高的植物的果实、种子或核果类、坚果类的果仁等为原料，在其加工制得的浆液中加入水、糖液等调制而成的可直接饮用的植物蛋白饮品的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
