(258, 'C', '19', '194', '1942', 4, 'C-19-194', 'C-19-194-1942', '羽毛（绒）制品加工', '指用加工过的羽毛(绒)作为填充物制作各种用途的羽绒制品(如羽绒服装、羽绒寝具、羽绒睡袋等)的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
