(260, 'C', '19', '195', '1951', 4, 'C-19-195', 'C-19-195-1951', '纺织面料鞋制造', '指用各种纺织面料、木材、棕草等原料缝制、模压或编制各种鞋的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
