(261, 'C', '19', '195', '1952', 4, 'C-19-195', 'C-19-195-1952', '皮鞋制造', '指全部或大部分用皮革、人造革、合成革为面料，以橡胶、塑料或合成材料等为外底，按缝绱、胶粘、模压、注塑等工艺方法制作各种皮鞋的生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(262, 'C', '19', '195', '1953', 4, 'C-19-195', 'C-19-195-1953', '塑料鞋制造', '指以聚氯乙烯、聚乙烯、聚氨酯和乙烯醋酸乙烯等树脂为原料生产发泡或不发泡的塑料鞋类制品的活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
