(266, 'C', '20', '201', '', 3, 'C-20', 'C-20-201', '木材加工', '　', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(267, 'C', '20', '201', '2011', 4, 'C-20-201', 'C-20-201-2011', '锯材加工', '指以原木为原料，利用锯木机械或手工工具将原木纵向锯成具有一定断面尺寸（宽、厚度）的木材加工生产活动，用防腐剂和其他物质浸渍木料或对木料进行化学处理的加工，以及地板毛料的制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(268, 'C', '20', '201', '2012', 4, 'C-20-201', 'C-20-201-2012', '木片加工', '指利用森林采伐、造材、加工等剩余物和定向培育的木材，经削（刨）片机加工成一定规格的产品生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(269, 'C', '20', '201', '2013', 4, 'C-20-201', 'C-20-201-2013', '单板加工', '指用于单板层积材（LVL）、纺织用木质层压板、电工层压木板和木质层积塑料等单位的生产；随着科技进步，装饰单板（厚度0.55mm以下的单板)发展很快,主要用于装饰贴面二次加工，如生产装饰贴面胶合板、实木复合地板、木质复合门窗、家具、楼梯、汽车内饰、木墙纸和踢脚线等', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(270, 'C', '20', '201', '2019', 4, 'C-20-201', 'C-20-201-2019', '其他木材加工', '指对木材进行干燥、防腐、改性、染色加工等活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(271, 'C', '20', '202', '', 3, 'C-20', 'C-20-202', '人造板制造', '指用木材及其剩余物、棉秆、甘蔗渣和芦苇等植物纤维为原料，加工成符合国家标准的胶合板、纤维板、刨花板、细木工板和木丝板等产品的生产活动，以及人造板二次加工装饰板的制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(272, 'C', '20', '202', '2021', 4, 'C-20-202', 'C-20-202-2021', '胶合板制造', '指具有一定规格的原木经旋（刨）切成单板，再经干燥、涂胶、组坯、热压而成的符合国家标准及供需双方协定标准的产品生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(273, 'C', '20', '202', '2022', 4, 'C-20-202', 'C-20-202-2022', '纤维板制造', '指用木材碎料（包括木片）、棉秆、甘蔗渣、芦苇等植物纤维作原料，经削片纤维分离，铺装成型，热压而成的产品生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(274, 'C', '20', '202', '2023', 4, 'C-20-202', 'C-20-202-2023', '刨花板制造', '指用木材碎料（包括木片）和其他植物纤维作原料，制成刨花，经干燥、施胶，铺装成型，热压而成的产品生产活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(275, 'C', '20', '202', '2029', 4, 'C-20-202', 'C-20-202-2029', '其他人造板制造', '包括非木质纤维、胶合木等其他各类人造板的制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(276, 'C', '20', '203', '', 3, 'C-20', 'C-20-203', '木制品制造', '指以木材为原料加工成建筑用木料和木材组件、木容器、软木制品及其他木制品的生产活动，但不包括木质家具的制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:35:43');
