(324, 'C', '24', '243', '2431', 4, 'C-24-243', 'C-24-243-2431', '雕塑工艺品制造', '指以玉石、宝石、象牙、角、骨、贝壳等硬质材料，木、竹、椰壳、树根、软木等天然植物，以及石膏、泥、面、塑料等为原料，经雕刻、琢、磨、捏或塑等艺术加工而制成的各种供欣赏和实用的工艺品的制作活动', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
