(731, 'C', '38', '387', '3871', 4, 'C-38-387', 'C-38-387-3871', '电光源制造', '电光源也称灯泡或电灯，本类是指将电能转变为光的器件的制造；目前按发光原理可分为白炽灯（指因电流通过使钨丝白炽而发光的灯）和气体放电灯（指电流通过灯两端的电极形成气体放电而产生光的灯）', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
