(732, 'C', '38', '387', '3872', 4, 'C-38-387', 'C-38-387-3872', '照明灯具制造', '指由起支撑、固定反射和保护作用的部件及联结光源所必须的电路辅助装置组合而成，将一个或多个光源发出的光进行控制分配或反射装置的制造；包括建筑物照明、道路照明、运输设备照明、生产照明、舞台照明等各种灯具的制造', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:30:27');
