INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(1082, 'I', '65', '652', '6520', 3, 'I-65', 'I-65-6520', '信息系统集成服务', '指基于需方业务需求进行的信息系统需求分析和系统设计，并通过结构化的综合布缆系统、计算机网络技术和软件技术，将各个分离的设备、功能和信息等集成到相互关联的、统一和协调的系统之中，以及为信息系统的正常运行提供支持的服务；包括信息系统设计、集成实施、运行维护等服务', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:36:10');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
(1083, 'I', '65', '653', '6530', 3, 'I-65', 'I-65-6530', '信息技术咨询服务', '指在信息资源开发利用、工程建设、人员培训、管理体系建设、技术支撑等方面向需方提供的管理或技术咨询评估服务；包括信息化规划、信息技术管理咨询、信息系统工程监理、测试评估、信息技术培训等', NULL, 0, '2016-04-21 11:11:35', '2016-04-21 11:36:10');
INSERT INTO industry(id, type, type_big, type_medium, type_small, level, parent_code, code, name, remark, review_template, sort_order, raw_add_time, raw_update_time) VALUES
