INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(1, 'COMPANY', 'SPECIAL', '1.法定代表人、实际控制人突然死亡，且严重影响我司授信资产安全的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(2, 'COMPANY', 'SPECIAL', '2.法定代表人、实际控制人失踪或发生其他突发性事件，以及发生吸毒、严重赌博等不良行为的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(3, 'COMPANY', 'SPECIAL', '3.作为违约或被告方涉及诉讼、仲裁，且严重影响我司授信资产安全的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(4, 'COMPANY', 'SPECIAL', '4.出现财产被查封、银行账户被冻结，且严重影响我司授信资产安全的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(5, 'COMPANY', 'SPECIAL', '5.被其他金融机构列为淘汰对象或已经采取淘汰措施的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(6, 'COMPANY', 'SPECIAL', '6.在我司或其他金融机构出现本金逾期、垫款或欠息，或在其他金融机构资产风险分类出现不良的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(7, 'COMPANY', 'SPECIAL', '7.抵（质）押物价值明显减少，且授信对象无能力或不配合我司采取补救措施的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(8, 'COMPANY', 'SPECIAL', '8.生产经营出现异常，股权、财务状况发生重大变化，可能会造成我司授信资产损失的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(9, 'COMPANY', 'SPECIAL', '9.上市公司被ST、*ST、违规处罚的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(10, 'COMPANY', 'SPECIAL', '10.投资经营失误、被欺诈、遭受灾害或遭遇大额经济纠纷等并造成重大损失的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(11, 'COMPANY', 'SPECIAL', '11.进行改制、改造、联营、合并、分立、合资、重组等，且严重影响我司授信资产安全的。', '2016-05-03 14:45:13', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(12, 'COMPANY', 'SPECIAL', '12.被有关部门如海关、税务、证券监管、环保、工商等立案查处，且影响企业正常经营的。', '2016-05-03 14:45:14', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(13, 'COMPANY', 'SPECIAL', '13.授信到期前三个工作日内，企业还款账户内资金无法足额清偿我司担保债务本息的。', '2016-05-03 14:45:14', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(14, 'COMPANY', 'SPECIAL', '14.资产大量被抵押，或对外提供大额的担保，接近或超过自身的承受能力，但又未能说明融资用途。', '2016-05-03 14:45:14', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(15, 'COMPANY', 'SPECIAL', '15.出售、变卖主要的生产、经营性固定资产。', '2016-05-03 14:45:14', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(16, 'COMPANY', 'SPECIAL', '16.其他可能导致我司授信资产损失的事项。', '2016-05-03 14:45:14', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(17, 'COMPANY', 'NOMAL', '1.频繁更换主要管理人员、财务人员或技术人员,以及出现集体辞职现象的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(18, 'COMPANY', 'NOMAL', '2.法定代表人、实际控制人死亡，但不会对我司授信资产安全造成严重影响的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(19, 'COMPANY', 'NOMAL', '3.作为违约或被告方涉及诉讼、仲裁，但不会对我司授信资产安全造成严重影响的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(20, 'COMPANY', 'NOMAL', '4.出现财产被查封、银行账户被冻结，但不会对我司授信资产安全造成严重影响的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(21, 'COMPANY', 'NOMAL', '5.突然发生重大关联交易的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(22, 'COMPANY', 'NOMAL', '6.授信需求增长异常或短期债务超常增加的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(23, 'COMPANY', 'NOMAL', '7.核心业务发生较大变动，库存发生异常，主要供货商或客户流失的；大额资金突然向新上下游企业转移的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(24, 'COMPANY', 'NOMAL', '8.主要财务指标发生异常，没有合理原因出现总资产、总负债、应收账款、其他应收款、存货、金融机构授信余额等与年初及上年同期比大幅增减及现金流量发生异常等对企业经营产生不利影响的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(25, 'COMPANY', 'NOMAL', '9.员工人数、用电量、上缴税款等有较大幅度减少的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(26, 'COMPANY', 'NOMAL', '10.客户自身的配套资金不到位或不充足的。', '2016-05-03 14:48:40', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(27, 'COMPANY', 'NOMAL', '11.产品出现严重质量问题，或企业被新闻媒体负面曝光，影响较大的。', '2016-05-03 14:48:41', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(28, 'COMPANY', 'NOMAL', '12.股东变更频繁的。', '2016-05-03 14:48:41', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(29, 'COMPANY', 'NOMAL', '13.资金往来异常的。', '2016-05-03 14:48:41', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(30, 'COMPANY', 'NOMAL', '14.贷款资金违规流入房市、股市等未及时进行纠正的。资金用途与评审报告披露信息严重不符，甚至将贷款挪作不正当用途，要求改正而不予改正。', '2016-05-03 14:48:41', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(31, 'COMPANY', 'NOMAL', '15.无正当理由而不按要求提供财务报表，不配合授信后跟踪检查。', '2016-05-03 14:48:41', '2016-05-10 13:41:02');
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(32, 'COMPANY', 'NOMAL', '16.对授信后跟踪检查中发现的问题和纠纷意见持不理睬或敷衍应付态度。', '2016-05-03 14:48:41', '2016-05-10 13:41:54');
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(33, 'COMPANY', 'NOMAL', '17.尚无逾月拖欠还款、还息、支付保费情形，但不能主动、及时履行，须多次催促、提醒。', '2016-05-03 14:48:41', '2016-05-10 13:41:08');
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(34, 'COMPANY', 'NOMAL', '18. 对于保函项目，如因承包原因导致工程进度略有滞后、工程款有拖欠但尚不严重的，受益人、保函申请人之间矛盾有日趋加深迹象。', '2016-05-03 14:48:41', NULL);
INSERT INTO risk_warning_signal(id, signal_type, signal_level, signal_type_name, raw_add_time, raw_update_time) VALUES
(35, 'COMPANY', 'NOMAL', '19.经判断其他应当列为一般预警信号的现象。', '2016-05-03 14:48:41', NULL);
